import React,  { useState, useEffect} from 'react'
import { useParams } from 'react-router'
import Navbar from '../components/Navbar/Navbar'

const RasteroPagina = () => {

  const [trackedGuide, setTrackedGuide] = useState("")
  const [guideInformation, setGuideInformation] = useState()

  // const params = useParams()
  // const guideNumber = parseInt(params.guide)
  // console.log(guideNumber)

  const getGuideInfo = async () => {
    const body = {
      "clientDetail": {
        "accountName": "rastreo@quiken.mx",
        "apiKey": "QNy1tpJFfmYIOlqF1oiwBy7iE46LXuwb"
      },
      "trackingNumbers": [
        100328
      ]
    }

    const url = 'http://api.quiken.mx/track'
    const response = await fetch(url, {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
        // 'Content-Type': 'application/x-www-form-urlencoded',
      },
      body: JSON.stringify(body)
    })
    const data = await response.json()
    setGuideInformation(data)
  }


  useEffect(() => {
    console.log(typeof guideNumber)
    getGuideInfo()  
  }, [])


  return (
    <>
      <Navbar/>
      <div>Hellow From Rastero</div>
    </>  
  )
}

export default RasteroPagina;
